import React from "react";
import ContactService from "./api/ContactService";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <>
    <Router>


      <Routes>
        <Route path="/d" element={<ContactService />} />
        <Route path="/e" element={<ContactService />} />
        <Route path="/f" element={<ContactService />} />
      </Routes>
    </Router>
    </>
  );
}

export default App;
